import React, { Component } from 'react';
import { Segment, Image } from 'semantic-ui-react';

class HomeContainer extends Component {
  render(){
    return (
      <div>
        <Image src='../../../public/favicon.ico'/>
      </div>
    )
  }
}

export default HomeContainer;
